import React from "react";
import creditPic from "./creditPic.png";
import "./style.css";

function CreditCard ({children}) {
    return (

            <div class="col s5 m5 l5">
                <div class="card" style={{marginTop:50}}>
                    <div class="card-image" id="inbox">
                        <img src={creditPic} style={{height:30 , width: 50}}></img>  
                        <span style={{ color: "black" }}>INBOX</span>
                    </div>
                    <div class="card-content">
                        <h1 style={{ color: "green" }}>{children}</h1>
                    </div>
                </div>
            </div>

    );
}

export default CreditCard;
